import React from "react";
import styles from "./robot.module.css";
import addShoppingCar from "../../assets/images/addShopingCar.svg";

interface humanProps {
  id: number;
  name: string;
  email: string;
}

const Robot: React.FC<humanProps> = ({ id, name, email }) => {
  const randomNumber = Math.random() * 1000;
  const price = <p>{randomNumber}</p>;

  return (
    <ul>
      <li className={styles.frame}>
        <img src={`https://robohash.org/${id}`}></img>
        <p>{name}</p>
        <p>{email} </p>
        price
        <button className={styles.button}>buy</button>
        <img
          src={addShoppingCar}
          alt="logo"
          className={styles.addShoppingCar}
        />
      </li>
    </ul>
  );
};

export default Robot;
